import React from 'react';

import HorizontalNavsCustom1 from '../components-custom/HorizontalNavsCustom1';
import CallToActionCustom2 from '../components-custom/CallToActionCustom2';
import StructuresCustom3 from '../components-custom/StructuresCustom3';
import StructuresCustom4 from '../components-custom/StructuresCustom4';


import { useEthers } from "@usedapp/core";
import { providers } from "ethers"

const avaxProvider = new providers.JsonRpcProvider("https://api.avax-test.network/ext/bc/C/rpc")
avaxProvider.pollingInterval = 10_000;

const config: Config = {
  readOnlyChainId: AvalancheTestnet.chainId,
  readOnlyUrls: {
    [AvalancheTestnet.chainId]: avaxProvider,
  },
  pollingInterval: 10000,
  notifications: {
    expirationPeriod: 1000,
    checkInterval: 1000
  }
}

export default function Index() {
  return (

    <React.Fragment>
      <HorizontalNavsCustom1 />

      <CallToActionCustom2 />

      <StructuresCustom3 />

      <StructuresCustom4 />
    </React.Fragment>

  );
}
